import { Component } from 'react';
import './App.css';
import Title from './Title/Title'

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="container">
          <h1 className="display-4">Twinkle cats</h1>
          <Title />
        </div>
      </div>
    );
  }
}

export default App;
